function dec2ip(decip) 
	local div, quote, ip;
	for i = 3, 0, -1 do
		div = 2 ^ (i * 8)
		quote, decip = math.floor(decip / div), math.fmod(decip, div)
			if nil == ip then
				ip = quote
				else ip = ip .. "." .. quote
			end
	end
	return ip
end




